import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
import { ReactComponent as FUBULogoSmall } from '../assets/fubu_logo_small.svg'
import Grid from '@material-ui/core/Grid';
import theme from '../theme';
import { Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
    },
    logo: {
        paddingTop: theme.spacing(8),
        textAlign: 'center',
        display: 'inline-block',
    },
    button: {
        width: '246px',
        paddingTop: theme.spacing(0),
        paddingBottom: theme.spacing(0),
        marginTop: '15px',
        marginBottom: '15px',
        fontSize: '24px',
        borderRadius: '8px',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.25)',
    },
    linkButton: {
        fontSize: '24px',
        textDecorationLine: 'underline',
        fontStyle: 'italic',
        fontWeight: 400,
        marginTop: '15px',
    },
    text: {
        marginTop: '10px',
        marginBottom: '25px',
    }
}));

function JoinWorkSpace() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container className={classes.root} >
                <Grid item xs={6}>
                    <Grid item xs={12}>
                        <FUBULogoSmall className={classes.logo}></FUBULogoSmall>
                    </Grid>
                    <Grid className={classes.text} item xs={12}>
                        <Typography variant="h1"> Hi (name we store here)! Are you:</Typography>
                    </Grid>           
                </Grid>
            </Grid>
        </ThemeProvider>

    );
}

export default JoinWorkSpace;
